/**
 *  StarDsTheme.OnLight
 */
@Composable
public fun StarDsTheme.OnLight(
    isDark: Boolean = isSystemInDarkTheme(),
    content: @Composable
    () -> Unit,
) {
    val colors = if (isDark) {
        darkOnLightColors
    } else {
        lightOnLightColors
    }
    val gradients = if (isDark) {
        darkOnLightGradients
    } else {
        lightOnLightGradients
    }
    StarDsTheme(
        colors = colors,
        gradients = gradients,
        content = content,
    )
}
